),(154,2,102,'dydyyd','2020-03-19 16:08:56'),(155,2,102,'vvn','2020-03-20 08:52:02'),(156,2,102,'Commet Node','2020-03-20 10:38:41'),(157,2,102,'Comment Node !','2020-03-20 10:39:23'),(158,2,102,'new','2020-03-20 15:20:34'),(159,74,102,'Test','2020-03-20 21:05:34'),(160,354,100,'Here’s how we Huddle:\n- Pick a facilitator or two\n- Show up on time, turn notifications and phones off and be present\n- Conduct a quick grounding exercise as a team\n- Share \'High Fives\'\n- Ask a \'Question of the Week\' \n- Check In – everyone gets the opportunity to share what’s on their heart and mind so we can support one another throughout the week\n- Share a story of WHY we do what we do from one volunteer','2020-03-21 07:32:16'),(161,74,100,'Hdjdjsjsbdjwzj\n','2020-03-21 07:58:48'),(163,74,103,'Yellow Hairy','2020-03-21 08:00:28'),(165,355,100,'Great post Gavin!!!','2020-03-21 08:03:30'),(166,356,100,'Great post. This is so true','2020-03-21 09:45:44'),(167,74,104,'Such a powerful message!','2020-03-21 12:00:52'),(168,74,100,'This is very true Gavin. Please can you share more like this.','2020-03-21 12:03:49'),(169,2,104,'hey','2020-03-23 15:06:56'),(170,359,105,'hii like or comment my post..','2020-03-24 14:11:28'),(171,357,105,'testing','2020-03-24 15:19:06'),(172,360,105,'Hello','2020-03-24 15:21:03'),(173,3,95,'Hii','2020-03-25 18:22:19'),(174,3,91,'Test','2020-02-26 16:22:35'),(175,3,102,'Hi','2020-03-25 18:39:49'),(176,3,102,'Hi','2020-03-25 18:41:24'),(177,3,102,'Hi','2020-03-25 18:42:33'),(178,3,102,'Hi','2020-03-25 18:43:38'),(179,3,102,'Hi','2020-03-25 18:44:52'),(180,3,95,'Hii','2020-03-25 18:22:19'),(181,3,95,'Hii','2020-03-25 18:22:19'),(182,3,95,'Hii','2020-03-25 18:22:19'),(183,3,95,'Hii','2020-03-25 18:22:19'),(184,3,102,'Hi','2020-03-25 18:50:57'),(185,3,102,'Test','2020-03-26 11:33:58'),(186,365,59,'Great post!','2020-03-27 20:15:17'),(187,366,100,'Great message Gavin','2020-03-27 20:25:10'),(188,74,102,'Great post','2020-04-04 14:32:06'),(189,74,102,'TWEET\nWhen I was running a digital marketing agency back in 2015, I primarily helped B2B tech brands grow their online following and increase engagement across platforms.\n\nBut the truth was that while these companies were getting googly-eyed over vanity metrics and acting as if they’d won the Grammy’s after receiving 50 likes on a Facebook post, they completely lost sight of the numbers that meant the most - their related income figures.\n\nAnd as predicted, their revenue didn’t budge. \n\nThis is when I decided to step away from B2B and instead begin consulting coaches, consultants and service-pro','2020-04-04 14:32:38'),(190,382,59,'Yes of course they play, all you have to do it click on them?','2020-04-04 15:01:30'),(191,74,110,'Great pic! Makes me feel so peaceful ?','2020-04-04 20:47:12'),(192,51,110,'Beaut pic hey','2020-04-05 08:17:06'),(193,385,102,'Sterkla is a marketplace that connects you with students who want your Tutoring.\n\nOn opening the app or web portal, students are easily able to:\n\nSearch and find you\nFollow you and your posts\nBuy your online courses (Quick Courses)\nEngage with you via paid live-video calling\nHow does billing work?\n\nWe take the hassle out of billing admin for you. Quick Courses and video call costs are deducted from the student’s credit card via our payment gateway.\n\nWhat is a Quick Course?\n\nAs a Tutor you can create a second revenue stream through Quick Courses, which members can purchase. This allows students to learn from your expertise while giving you the opportunity to build your credibility and following.\n\nHow do I Build a Following?\n\nA rating system between Tutor and Student will help you to establish yourself as a top rated tutor in your chosen field of expertise. This rating system is designed to encourage good quality tutoring.\n\n No contracts, No registration fees, No monthly fees!\n\nOnly pay when you tutor. Keep 75% of your tutoring fee, and keep 100%-5% transaction fee when you invite and tutor your existing clients.\n\n','2020-04-05 13:46:30'),(194,386,30,'test','2020-04-06 10:59:06'),(195,1,96,'Test comment Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment  Test comment .','2020-04-06 16:26:47'),(198,51,111,'Nice post Gav. An interesting read','2020-04-11 10:36:57'),(201,51,113,'I like your post Gav','2020-04-11 16:05:40'),(206,51,93,'great article','2020-04-12 09:00:55'),(212,130,116,'Great video Gavin. Simple principles but not easy to apply! Looking forward to more of these to help keep me on track. ??????','2020-04-14 08:15:01'),(219,270,109,'Nice post','2020-04-15 15:57:23'),(220,270,2,'Hello','2020-04-15 15:59:25'),(221,270,95,'Test','2020-04-15 15:59:44'),(222,270,2,'Hiii','2020-04-15 16:14:55'),(223,270,2,'Nice','2020-04-15 16:15:09'),(224,270,109,'Good one','2020-04-15 16:30:29'),(225,8,109,'test','2020-04-15 17:06:17'),(226,8,109,'test','2020-04-15 17:22:17'),(227,8,109,'test','2020-04-15 17:27:06'),(228,8,109,'yest','2020-04-15 17:28:38'),(229,8,109,'tesr','2020-04-15 17:36:37'),(230,8,109,'test','2020-04-15 17:38:28'),(231,8,109,'test','2020-04-15 17:39:24'),(232,8,109,'Abhinav sir test notification','2020-04-15 18:03:21'),(233,1,109,'Jjhasjkhajhgdjhagdjhadgjhahdag\nJdkhadkjhdjhkjadshkjas\nJahsdkajhdkjahdkjah\nJhdkjshdkjsdhksjdks\nJsdhkjsdjksdhksjjhdjs kdjslkdjlsk Sikhism ,msjhdkjs m,sndkjsk ,sjdkjs','2020-04-15 18:06:12'),(234,8,109,'hello sir','2020-04-15 18:06:49'),(235,1,95,'Hsdgsh jhdjshd jhdjshd jhdjshd hdsjdh jhdjshd jhdjshd jhdjshd jhdjshd jhdjshd jhdjshd sjhdjshd shdjshdjshds jhdjshd hsdjshdjsn subsides','2020-0