 virtual reality will transform training and coaching for the betterNEWS ARTICLE DIGITALIZATION ACC\'S LABSCROLL TO DISCOVERaccilium is a boutique consultancy, which has recognized that digitalization and automatization will affect not only everyone’s daily routine, but also the overall qualification requirements and employment models. Consequently, our approach is disruptive, interdisciplinary and future-oriented.  Digitalization – What does it mean for business communication? The digital age is omnipresent and embedded in an increasingly complex world. Every hour, 8 billion people are trying to communicate across countries, time zones and based on their individual mental models. On top of that, many meetings do not take place in-person but are based on remote collaboration.  The expression of content, the pace of a conversation, as well as each other’s body language are more limited when using video conferencing tools such as Skype. This results in misunderstandings, inefficient discussions and stressed employees.  accilium is aware that it is necessary to grasp the problem at its roots, to re-think communication and to overcome frustrating meeting sessions. That is why we teamed up with Arthur Technologies. Arthur Technologies is a startup company, which provides a VR Conferencing solution for teams that are dealing with complex challenges such as product meetings, strategy sessions and creative workshops.   Virtual Reality is complementing physical meetings  Arthur´s product combines the power of physical meetings, with the simplicity of video calls. Thanks to a personalized and digitalized avatar, the expression of the individual body language becomes more realistic, thus interactive. Additionally, VR-rooms offer its participants the possibility to make notes, rough drawings or use the voice application which represents an interface with the software. This supports the maintena','','','',11,'2019-10-16'),(11,7,7,'Test','','https://res.cloudinary.com/dggygbxfk/v