>Do You Need to Hold a Stretch to Get the Benefit?<br />Not necessarily.<br /><br /><br />Stretching a muscle to the full extent of your ability and holding it for 15 to 30 seconds is what\'s called a static stretch, and there\'s no harm in stretching that way as long you don\'t stretch until it hurts.<br /><br />But studies suggest a dynamic stretch is just as effective, and sometimes better, especially before your workout.<br /><br />A dynamic stretch, like the Standing Cat-Camel, moves a muscle group fluidly through an entire range of motion.<br /><br />www.stretch.com','','','',72,'2019-10-19'),(55,19,20,'sfdsdf','sfddsf','https://res.cloudinary.com/dggygbxfk/image/upload/v1571634957/souqAmazon-logo-v2-X2_np1rde.jpg','','image',82,'2019-10-21'),(56,19,20,'sdsdf','Using jQuery to disable a button has many advantages as it will allow you to enable and disable the button based on user interaction. You will easily be able to use this code with other jQuery implementations. Lets get started.<br />Starting out we are going to create a very basic HTML form that will have an input and a button, this simple form will pretend to be a search form, but will not work as part of this tutorial.<br />The idea is that we don’t want the user to be able to press the search button until they have entered some text into the search input box.<br /><br />Using jQuery to disable a button has many advantages as it will allow you to enable and disable the button based on user interaction. You will easily be able to use this code with other jQuery implementations. Lets get started.<br />Starting out we are going to create a very basic HTML form that will have an input and a button, this simple form will pretend to be a search form, but will not work as part of this tutorial.<br />The idea is that we don’t want the user to be able to press the search button until they have entered some text into the search input box.<br />Using jQuery to disable a button has many advantages as it will allo