','www.zoho.com','','','',82,'2019-10-21'),(64,22,23,'wn','ewew','https://res.cloudinary.com/dggygbxfk/image/upload/v1571645199/add_otjbsh.png','','image',2,'2019-10-21'),(65,22,23,'fitness','sse bdas bdhasgsaf hjnfbhsdfb nsfbfb','https://res.cloudinary.com/dggygbxfk/video/upload/v1571645236/SAIA_Perfect_Fit__How_to_take_photos_hjajdu.mp4','https://res.cloudinary.com/dggygbxfk/video/upload/v1571645236/SAIA_Perfect_Fit__How_to_take_photos_hjajdu.jpg','video',2,'2019-10-21'),(66,22,23,'jh','w','https://res.cloudinary.com/dggygbxfk/video/upload/v1571645294/file_example_MP4_1280_10MG_khcdzc.mp4','https://res.cloudinary.com/dggygbxfk/video/upload/v1571645294/file_example_MP4_1280_10MG_khcdzc.jpg','video',2,'2019-10-21'),(67,22,23,'test','www.facebook.com','https://res.cloudinary.com/dggygbxfk/image/upload/v1571645363/3EE84854-F6D8-43A2-9553-E6CBB4834F26_fr9yzj.jpg','','image',2,'2019-10-21'),(68,24,24,'Test','gavinlund.com<br /><br />www.gavinlund.com<br /><br />https://gavinlund.com','','','',86,'2019-10-22'),(69,24,24,'Test 2','This is a highly specialized process designed to improve the effectiveness and integration of a team and offer simple, practical and usable tools for self motivation and dealing with people.  This programme demonstrates the potential of all human beings and encourages the delegates via practical application to become more focused, accountable, proactive and positive.<br /><br /> <br /><br /> <br /><br />Objectives & Outcomes<br /><br />This programme can be customised to meet specific outcomes, such as…<br /><br /> <br /><br />Improving the effectiveness of a team<br /><br />Changing culture and cutting through miscommunication and perceptions<br /><br />Creating understanding and resolving conflict between departments or teams<br /><br />Gelling teams who have been through big changes, i.e. change in management or leadership<br /><br />Resolving conflict within teams<br /><br />Dealing with customers, and building relationships effectively<br /><br />Style of Presentation<br /><br />The programme is extremely participative. All delegates are fully involved and are encouraged to put the skills into practice as they work through the programme. The programme is simple, fun and above all, practical, and therefore bridges the gap between training and practical application.  Although delegates will discover their own strengths and will be made aware of the areas in which they can be more effective or how their behaviour is being perceived by the team, the seminar is in no way confrontational or threatening.<br /><br />Content<br /><br /> <br /><br />The group is given a simple understanding of how our programming in life happens, and the roles that perceptions, values, beliefs, cultures and habits play in our day to day interaction with our fellow human beings, and why we all see life differently.<br /><br />The delegates assess the company in terms of strengths and weaknesses and through a detailed process, come out with practical solutions to rectify some of these areas.<br /><br />Delegates will be made aware of the affect their behaviour has on the team and how it is being perceived.<br /><br />A very practical session on the mind is given, allowing delegates to understand in a very simple way how influential their state of mind is in achieving positive results.<br /><br />They will learn simple yet effective ways of changing their thinking habits and how to programme new beliefs.<br /><br />Delegates will come to understand that their attitude has a major effect on their results in life.<br /><br />Delegates will discuss the differences in people.<br /><br />They will learn, through a measuring process, how to read and understand appearances and behaviours in others.<br /><br />Delegates will be taught a simple process of measuring behaviours to ascertain the individual’s personality style.<br /><br />Each delegate will be measured and given accurate and practical feedback of their personal style, including their secondary style.<br /><br />Delegates will learn the simple but practical ways of approaching the different styles to build trust and rapport.<br /><br />They will identify people with whom they have had problems communicating, and thereby understand how to rectify and build a relationship with that person.<br /><br />Delegates will learn the meaning of flexibility in communication. We cannot change our personality, but will learn how to adapt to others.<br /><br />All delegates will have lots of fun while learning.','','','',86,'2019-10-22'),(70,19,20,'asd','asd','https://res.cloudinary.com/dggygbxfk/video/upload/v1571827461/Penguins_of_Madagascar_xhy9yg.mp4','https://res.cloudinary.com/dggygbxfk/video/upload/v1571827461/Penguins_of_Madagascar_xhy9yg.jpg','video',82,'2019-10-23'),(71,25,25,'test','https://www.youtube.com/','https://res.cloudinary.com/dggygbxfk/image/upload/v1571828812/download_1_liyqtg.jpg','','image',95,'2019-10-23'),(72,25,25,'fitness','jhwqdhjssbd','https://res.cloudinary.com/dggygbxfk/video/upload/v1571828874/Message_from_the_Chief_Election_Commissioner_of_India_on_the_occasion_of_9th_NVD_English_ghxt9z.mp4','https://res.cloudinary.com/dggygbxfk/video/upload/v1571828874/Message_from_the_Chief_Election_Commissioner_of_India_on_the_occasion_of_9th_NVD_English_ghxt9z.jpg','video',95,'2019-10-23'),(75,27,26,'Test','Sh dhbd dhbd dhb gdhdh','https://res.cloudinary.com/dggygbxfk/video/upload/v1571983862/trim.86B350A1-48D2-491F-908F-18FB9483102D_n50bjl.mov','https://res.cloudinary.com/dggygbxfk/video/upload/v1571983862/trim.86B350A1-48D2-491F-908F-18FB9483102D_n50bjl.mov','video',85,'2019-10-25'),(76,28,27,'Test','LawTrades has partnered with Stripe Atlas to help their users with the incorporation process, post incorporation process, dissolution, general legal advice and startup related legal services. <br /><br />We\'re here to help Atlas customers with complex legal needs and questions before and after the incorporation process. LawTrades allows companies from all over the globe to connect with world class lawyers across a broad range of different practice areas. <br /><br />A selective platform consisting of top-notch startup, corporate, immigration, patent, IP, and employment attorneys. Use LawTrades for one-off requests or to build meaningful relationships with attorneys that can help your business. <br />Getting Started<br />Step One<br />Go through our intake process and answer questions about what you need help with. <br />Step Two<br />Our platform routes this request to the relevant lawyers that could assist. Request price estimates and book consultations with LawTrades lawyers. <br />Step Three<br />LawTrades facilitates payment processing, communication with the attorney and a dashboard to keep everything organized. <br />Top Backgrounds<br />LawTrades lawyers have worked at top firms and companies. Now they run independent practices so that we can pass savings directly to our customers.  <br />Law Schools<br />Harvard<br />NYU <br />Penn <br />Columbia <br />Michigan<br /><br />Law Firms<br />Latham & Watkins <br />Wilson Sonsini <br />Skadden <br />Perkins Coie <br />Kirkland & Ellis<br />5,000+<br />Projects Completed<br />300+<br />Active Projects<br />150+<br />Attorneys Available<br /><br />www.gavinlund.com','','','',86,'2019-10-28'),(77,28,27,'Test','www.gavinlund.co.za','','','',86,'2019-10-28'),(79,21,30,'test','testing','','','',3,'2019-11-18'),(80,21,30,'t','t','http://sterklastazingimages.s3.amazonaws.com/1574075997762.JPEG','','image',3,'2019-11-18'),(81,32,31,'test','test','','','',3,'2019-11-18'),(82,21,30,'as','app.sterkla.com','','','',3,'2019-11-25'),(83,21,30,'s','www.zoho.com/','','','',3,'2019-11-25'),(84,34,33,'Test','Test','https://outsterklaimages.s3-us-west-2.amazonaws.com/sterkla_mp4/1576828537519.mp4','https://outsterklaimages.s3-us-west-2.amazonaws.com/sterkla_mp4/1576828537519.mp4-00001.png','video',1,'2019-12-20'),(85,21,30,'asd','adsasd','http://sterklastazingim