INSERT INTO `email_templates` VALUES (1,'Coach Welcome','Welcome to the Sterkla Coach / Tutor Community!','<p>Hi FIRST_NAME,</p>\n\n<p>&nbsp;</p>\n\n<p>Thanks for registering as a coach / tutor on Sterkla, we are so excited to have you join our Coach / Tutor Community.&nbsp; We are on a mission&nbsp;to make coaching and tutoring accessible to&nbsp;every person on the planet, and together with your help we can reach more people and so help to awaken the world.&nbsp; We believe that our job is to support you in making it as easy as possible to succeed in your coaching or tutoring&nbsp;business.&nbsp; By connecting you to more clients across the globe and handling the administrative aspects of your business, you can focus on what you do best, coaching and tutoring.</p>\n\n<p>&nbsp;</p>\n\n<h2>IMPORTANT: We are releasing some exciting new features and changes in Version 2.0 which will launch soon in April</h2>\n\n<p>&nbsp;</p>\n\n<hr />\n<p><strong>ACTION REQUIRED:</strong> Please login to the mobile app or <strong><a href=\"https://app.sterkla.com\">Sterkla web app</a></strong> to&nbsp;complete your coach profile.&nbsp;</p>\n\n<hr />\n<p>&nbsp;</p>\n\n<p>If you also want to <strong>register as a member</strong>, simply&nbsp;click <strong>&quot;Register as a Member&quot; </strong>from the burger menu in the app.&nbsp; Once you are registered as both a coach and a member, you will see an option to <strong>switch between coach / tutor and member</strong> in the burger menu&nbsp;of the mobile app or in the main menu of the web app.&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>To assist you in familiarizing yourself with Sterkla please visit our&nbsp;<strong><a href=\"https://sterkla.com/knowledge-base/\">Help Centre</a>, </strong>you can also access it via the FAQ&#39;s in the app.</p>\n\n<p>Please also join our <strong><a href=\"https://www.facebook.com/groups/sterklacoaches/\">Sterkla Coach / Tutor Community</a></strong><strong> </strong>Facebook Group.</p>\n\n<p>&nbsp;</p>\n\n<hr />\n<p>&nbsp;</p>\n\n<p><strong>Here are a few important points to get you started&hellip;</strong></p>\n\n<p>&nbsp;</p>\n\n<h2>Free Coaching / Tutoring to New Members</h2>\n\n<p>We offer new members (non-coaches / tutors) 90 minutes of free coaching or tutoring which they can use to book appointments with you and other coaches or tutors. You have the option to opt in / opt out of this by simply switching it on / off in the settings. However, if you opt in, it does give you the chance to make an impression on new members and gain new clients. Free appointment requests will carry a FREE tag, so you will know that they are free.</p>\n\n<p>&nbsp;</p>\n\n<h2>How Does the Coaching or Tutoring Happen?</h2>\n\n<p>When a member books an appointment with you, you will receive an Appointment Request, which you can accept or reject.&nbsp; If&nbsp;you accept it, the appointment will be confirmed. Approximately 15 minutes before the appointment is due to begin, a&nbsp;green video call button will replace the &ldquo;Cancel&rdquo; button on the appointment, as shown below.&nbsp; Simply click this video call button to initiate the call. Coaching and Tutoring happens via live video calling, all from within the app or web app.&nbsp;&nbsp;<strong>NB! Microsoft Internet Explorer / Edge is not supported for video calling, as it does not meet our security requirements.</strong></p>\n\n<p>&nbsp;</p>\n\n<p><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1580114538_upload.png\" /></p>\n\n<p>&nbsp;</p>\n\n<h2>Coach / Tutor Invite Code</h2>\n\n<p>You have your own unique invite code, which you can find in the app settings.&nbsp; You can share this code with your existing clients.&nbsp; When you coach or tutor members who have registered with your code you will receive 100% (less a 5% transaction fee) of your appointment fee.&nbsp; Similarly, when one of these members buys one of your Quick Courses you will also receive 100% (less a 5% transaction fee) of the course fee.</p>\n\n<p>&nbsp;</p>\n\n<h2>Cancelling an&nbsp;Appointment</h2>\n\n<p>If you need to, you can cancel an appointment with a member, however, should we feel that you are consistently cancelling appointments to the detriment of the platform, it may result in your&nbsp;account being suspended. Once you have accepted an appointment request from a member, it is considered &ldquo;Confirmed&rdquo;.&nbsp; Should the member wish to cancel a confirmed appointment, they must cancel it more than 12 hours prior to the start time.&nbsp; Cancellations within 12 hours, but more than 4 hours prior to the start of the appointment will carry a 50% cancellation fee for that member.&nbsp; Any appointments cancelled by a member within 4 hours of the session will be charged in full.&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<h2>Commission</h2>\n\n<p>If you coach or tutor&nbsp;your existing clients who have registered using your invite code, you will get to keep 100% of your appointment fee and only be charged a 5% transaction fee. When you coach or tutor an existing Sterkla member you get to keep 75% of your appointment fee. You can keep a track of your earnings on your Coach / Tutor Dashboard. Earnings will be paid into your Sterkla eWallet&nbsp;on a monthly basis.</p>\n\n<p>&nbsp;</p>\n\n<h2>Getting Paid (Sterkla Global eWallet powered by I-Payout)</h2>\n\n<p>Once you accept your first appoinmtent request from a client, we will automatically create your free Sterkla Global eWallet&nbsp;account powered by I-Payout.&nbsp; After which you will receive an email from Sterkla Global eWallet where you will be required to complete a few steps to set up your eWallet.&nbsp; Please watch out for this email, and if you don&#39;t receive it please check your spam folder.&nbsp; Monthly payouts will paid into your eWallet.&nbsp; Please note that we have a&nbsp;minimum payout amount of $50.&nbsp; If your earnings for the month are less than $50 they&nbsp;will be carried over. You will have several options on how you withdraw your money, one of which is to withdraw it directly into your bank account.</p>\n\n<p>&nbsp;</p>\n\n<h2>Accessing the Platform</h2>\n\n<p>You can access the Sterkla platform via our mobile app, click here to download it from the&nbsp;<a href=\"http://apps.apple.com/us/app/id1472511908\">Apple App Store</a> or&nbsp;click here to download it from the&nbsp;<a href=\"http://play.google.com/store/apps/details?id=com.sterkla.app\">Google Playstore</a>.&nbsp; We also have a web app, <a href=\"https://app.sterkla.comw\">https://app.sterkla.com</a> &nbsp;where you can access most of the mobile app features, including video calling, as you may find it easier to conduct the coaching via your laptop rather than your mobile phone.</p>\n\n<p>&nbsp;</p>\n\n<h2>Quick Courses</h2>\n\n<p>You can create Quick Courses to support your coaching or tutoring&nbsp;and expand your earnings.&nbsp; Quick Courses are a lite version of a typical online course,&nbsp;where we encourage you to focus the course around a very specific topic, with a very clear learning goal in mind.&nbsp; You can access the Quick Course Wizard by logging into the <a href=\"https://app.sterkla.com\">Webapp</a>, click <strong>&quot;Switch&nbsp;to Coach / Tutor&quot;</strong>&nbsp;then&nbsp;click&nbsp;<strong>&ldquo;Quick Courses&rdquo;</strong>. You can then follow the onscreen instructions to build your online Quick Course.&nbsp;&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<h2>Coach / Tutor Badges</h2>\n\n<p>We have four different badges that you can achieve based on your experience on the Sterkla platform.&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\">\n	<tbody>\n		<tr>\n			<td><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573471381_upload.png\" /></strong></td>\n			<td>\n			<p><strong>Bright Spark</strong></p>\n\n			<p>Bright Sparks are super smart coaches or tutors who are still building up their hours on Sterkla. They have done less than 150 hours of coaching or tutoring on Sterkla!</p>\n			</td>\n		</tr>\n		<tr>\n			<td><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573471439_upload.png\" /></strong></td>\n			<td>\n			<p><br />\n			<strong>Rising Star</strong></p>\n\n			<p>Rising Stars are coaches or tutors who are beginning to shine with their growing number of hours on Sterkla. They have done between 150 &ndash; 400 hours of coaching or tutoring on Sterkla!</p>\n			</td>\n		</tr>\n		<tr>\n			<td><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573471458_upload.png\" /></strong></td>\n			<td>\n			<p>&nbsp;</p>\n\n			<p><strong>Shooting Star</strong></p>\n\n			<p>Shooting Stars are coaches or tutors who are really standing out through their brilliance and amazing experience.&nbsp; They have done between 400 &ndash; 1000 hours of coaching or tutoring on Sterkla!</p>\n			</td>\n		</tr>\n		<tr>\n			<td><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573471475_upload.png\" /></strong></td>\n			<td>\n			<p>&nbsp;</p>\n\n			<p><strong>Super Star</strong></p>\n\n			<p>Super Stars are our most experienced coaches and tutors and are awakening the world with their coaching and tutoring superpowers. They have done over 1000 hours of coaching or tutoring on Sterkla!</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<h2>Member Badges</h2>\n\n<p>We have four different badges that members can achieve based on how much coaching or tutoring they have had on the platform, so you will always know where they are on their Sterkla journey.&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\">\n	<tbody>\n		<tr>\n			<td><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573470942_upload.png\" /></strong></td>\n			<td>\n			<p><strong>Rookie</strong></p>\n\n			<p>Rookies have had less than 10 hours of coaching or tutoring, and are beginning their exciting journey of personal growth, as they move towards becoming Explorers!</p>\n			</td>\n		</tr>\n		<tr>\n			<td><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573470977_upload.png\" /></strong></td>\n			<td>\n			<p><br />\n			<strong>Explorer</strong></p>\n\n			<p>Explorers have had between 10 &ndash; 60 hours of coaching or tutoring, and are fast building self-awareness and knowledge, as they move towards becoming Awakening Explorers!</p>\n			</td>\n		</tr>\n		<tr>\n			<td><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573471003_upload.png\" /></strong></td>\n			<td>\n			<p>&nbsp;</p>\n\n			<p><strong>Awakening Explorer</strong></p>\n\n			<p>Awakening Explorers have had between 60 &ndash; 100 hours of coaching or tutoring, and are beginning to enter self-mastery, as they progress towards becoming Enlightened Masters!</p>\n			</td>\n		</tr>\n		<tr>\n			<td><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573471023_upload.png\" /></strong></td>\n			<td>\n			<p>&nbsp;</p>\n\n			<p><strong>Enlightened Master</strong></p>\n\n			<p>Enlightened Masters have had more than 100 hours of coaching or tutoring, and are changing the world with their wisdom!</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<p>Once again, welcome to the Sterkla Coach / Tutor Community.&nbsp; We are always here to help whenever you need us, simply contact us at <a href=\"mailto:coaches@sterkla.com\">coaches@sterkla.com</a> for coach related queries or <a href=\"mailto:support@sterkla.com\">support@sterkla.com</a> for general support.</p>\n\n<p>&nbsp;</p>\n\n<p>Warmest regards,</p>\n\n<h3><strong>The Sterkla Team</strong></h3>\n\n<p><a href=\"mailto:coaches@sterkla.com\"><strong>coaches@sterkla.com</strong></a></p>\n\n<p><strong><a href=\"http://www.sterkla.com\">www.sterkla.com</a></strong></p>\n\n<p><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1586955928_upload.png\" style=\"height:139px; width:400px\" /></strong></p>\n'),(2,'Member Welcome','Welcome to Sterkla!','<p>Hi FIRST_NAME,</p>\n\n<p>Thanks for signing up, we are so excited to have you join our Sterkla community.&nbsp; We are on a mission&nbsp;to make coaching accessible to&nbsp;every person on the planet, and so&nbsp;help to awaken the world.&nbsp; We believe that our job is to make it as easy as possible for you to connect with the coaches you need, in the areas in which you need support.</p>\n\n<p>&nbsp;</p>\n\n<hr />\n<p>&nbsp;</p>\n\n<p><span style=\"color:#1f4067\"><strong>Here are a few important points to get you started&hellip;</strong></span></p>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"color:#1f4067\">Free Coaching</span></h2>\n\n<p>As a new member you automatically qualify for 90 minutes of free coaching.&nbsp; While some coaches have opted out of this offering, you can use your free minutes to book coaching sessions with multiple coaches.&nbsp; This gives you the opportunity to experience the platform and their coaching with no risk.</p>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"color:#1f4067\">Video Calling</span></h2>\n\n<p>Once you have booked an appointment with a coach, a video call button will appear just before the session is due to begin.&nbsp; Coaching happens via live video calling, all from within the app or web app.</p>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"color:#1f4067\">Cancelling a Coaching Appointment</span></h2>\n\n<p>Once a coach has accepted your appointment request, it is considered &ldquo;Confirmed&rdquo;.&nbsp; Should you wish you cancel a confirmed appointment, you must cancel it more than 12 hours prior to the start time.&nbsp; Cancellations within 12 hours, but more than 4 hours prior to the sessions will carry a 50% cancellation fee.&nbsp; Any appointments cancelled within 4 hours of the sessions will be charged in full.</p>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"color:#1f4067\">Accessing the Platform</span></h2>\n\n<p>You can access the Sterkla platform via our mobile app,&nbsp;click here to download it from the&nbsp;<a href=\"http://apps.apple.com/us/app/id1472511908\">Apple App Store</a> or&nbsp;click here to download it from the&nbsp;<a href=\"http://play.google.com/store/apps/details?id=com.sterkla.app\">Google Playstore</a>.&nbsp; We also have a web app, <a href=\"https://app.sterkla.comw\">https://app.sterkla.com</a> &nbsp;where you can access most of the mobile app features, including video calling, as you may find it easier to conduct the coaching via your laptop rather than your mobile phone.</p>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"color:#1f4067\">Quick Courses</span></h2>\n\n<p>In the app we have a library of Quick Courses.&nbsp; Quick Courses are online courses that focus on a very specific topic, with a very clear learning objective. You can try 30% of any Quick Course for free, which you can do from the mobile app or web app.&nbsp; You will, however, need to login to the web app to purchase a Quick Course.&nbsp; Once you have purchased it on the webapp it will automatically be available on your mobile app as well.</p>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"color:#1f4067\">Making Purchases on the Platform</span></h2>\n\n<p>In order to&nbsp;complete purchases on the platform, you will need to register a free PayPal account and add your credit card details. In the mobile app Settings Menus under &ldquo;Billing&rdquo; you will see &ldquo;Setup PayPal Account&rdquo; where you can register your free PayPal account. If you already have a PayPal account, all you need do is Login to Paypal during the checkout process to complete a purchase.</p>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"color:#1f4067\">Awareness Rewards (AR)</span></h2>\n\n<p>In the app you have your own unique invite code, you can use this to invite your friends to Sterkla.&nbsp; When one of your friends registers with your code and has their first paid coaching session or purchases their first Quick Course, you will receive AR50 which you can redeem for coaching or Quick Courses.&nbsp; AR10 = $1.</p>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"color:#1f4067\">Member Badges</span></h2>\n\n<p>We have four different badges that you can achieve based on how much coaching you have had, so that coaches know how serious you are about you own growth.&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:500px\">\n	<tbody>\n		<tr>\n			<td>\n			<p>Hi FIRST_NAME,</p>\n\n			<p>Thanks for signing up, we are so excited to have you join our Sterkla community.&nbsp; We are on a mission&nbsp;to make coaching and tutoring accessible to&nbsp;every person on the planet, and so&nbsp;help to awaken the world.&nbsp; We believe that our job is to make it as easy as possible for you to connect with the coaches and tutors you need, in the areas in which you need support.</p>\n\n			<p>&nbsp;</p>\n\n			<h2>IMPORTANT: We are releasing some exciting new features and changes in Version 2.0 which will launch soon in April</h2>\n\n			<p>&nbsp;</p>\n\n			<hr />\n			<p>&nbsp;</p>\n\n			<p>To assist you in familiarizing yourself with Sterkla please visit our&nbsp;<strong><a href=\"https://sterkla.com/knowledge-base/\">Help Centre</a>, </strong>you can also access it via the FAQ&#39;s in the app.</p>\n\n			<p>&nbsp;</p>\n\n			<p><strong>Here are a few important points to get you started&hellip;</strong></p>\n\n			<p>&nbsp;</p>\n\n			<h2>Free Coaching</h2>\n\n			<p>As a new member you automatically qualify for 90 minutes of free coaching or tutoring.&nbsp; While some coaches and tutors have opted out of this offering, you can use your free minutes to book appointments with many coaches and tutors.&nbsp; This gives you the opportunity to experience the platform at&nbsp;no risk.</p>\n\n			<p>&nbsp;</p>\n\n			<h2>How Does the Coaching &amp; Tutoring Happen?</h2>\n\n			<p>Once you have booked&nbsp;an appointment with a coach ot tutor, they&nbsp;will receive the&nbsp;appointment request, once&nbsp;they accept it you will be notified via email.&nbsp; Shortly before the appointment is due to begin,&nbsp;a green video call button will replace the Cancel button&nbsp;on the appointment, as shown below.&nbsp; Simply click or tap this button to initiate the video call.&nbsp; All the coaching and tutoring on Sterkla happens via live video calling&nbsp;from within the app or web app.&nbsp;&nbsp;<strong>NB! Microsoft Internet Explorer / Edge is not supported for video calling, as it does not meet our security requirements.</strong></p>\n\n			<p>&nbsp;</p>\n\n			<p><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1578906686_upload.png\" /></p>\n\n			<p>&nbsp;</p>\n\n			<h2>Cancelling an&nbsp;Appointment</h2>\n\n			<p>Once a coach or tutor has accepted your appointment request, it is considered &ldquo;Confirmed&rdquo;.&nbsp; Should you wish you cancel a confirmed appointment, you must cancel it more than 12 hours prior to the start time.&nbsp; Cancellations within 12 hours, but more than 4 hours prior to the appointment will carry a 50% cancellation fee.&nbsp; Any appointments cancelled within 4 hours of the sessions will be charged in full.</p>\n\n			<p>&nbsp;</p>\n\n			<h2>Accessing the Platform</h2>\n\n			<p>You can access the Sterkla platform via our mobile app,&nbsp;click here to download it from the&nbsp;<a href=\"http://apps.apple.com/us/app/id1472511908\">Apple App Store</a> or&nbsp;click here to download it from the&nbsp;<a href=\"http://play.google.com/store/apps/details?id=com.sterkla.app\">Google Playstore</a>.&nbsp; We also have a web app, <a href=\"https://app.sterkla.comw\">https://app.sterkla.com</a> &nbsp;where you can access most of the mobile app features, including video calling, as you may find it easier to conduct the coaching via your laptop rather than your mobile phone.</p>\n\n			<p>&nbsp;</p>\n\n			<h2>Quick Courses</h2>\n\n			<p>In the app we have a library of Quick Courses.&nbsp; Quick Courses are a lite version of a typical online course, and focus on a very specific topic&nbsp;with a very clear learning objective. You can try 30% of any Quick Course for free, which you can do from the mobile app or web app.&nbsp; You will, however, need to login to the web app to purchase a Quick Course.&nbsp; Once you have purchased it on the webapp it will automatically be available on your mobile app as well.</p>\n\n			<p>&nbsp;</p>\n\n			<h2>Awareness Dollars (AD)</h2>\n\n			<p>In the app you have your own unique invite code, you can use this to invite your friends to Sterkla.&nbsp; When one of your friends registers with your code and makes their first purchase, you will receive AD50 which you can redeem for coaching or Quick Courses.&nbsp; AD10 = $1.</p>\n\n			<p>&nbsp;</p>\n\n			<h2>Member Badges</h2>\n\n			<p>We have four different badges that you can achieve based on how much coaching or tutoring you have had, so that coaches and tutors know how serious you are about you own learning and growth.&nbsp;</p>\n\n			<p>&nbsp;</p>\n\n			<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\">\n				<tbody>\n					<tr>\n						<td><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573470942_upload.png\" /></strong></td>\n						<td>\n						<p><strong>Rookie</strong></p>\n\n						<p>Rookies have had less than 10 hours of coaching or tutoring, and are beginning their exciting journey of personal growth, as they move towards becoming Explorers!</p>\n						</td>\n					</tr>\n					<tr>\n						<td><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573470977_upload.png\" /></strong></td>\n						<td>\n						<p><br />\n						<strong>Explorer</strong></p>\n\n						<p>Explorers have had between 10 &ndash; 60 hours of coaching or tutoring, and are fast building self-awareness and knowledge, as they move towards becoming Awakening Explorers!</p>\n						</td>\n					</tr>\n					<tr>\n						<td><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573471003_upload.png\" /></strong></td>\n						<td>\n						<p>&nbsp;</p>\n\n						<p><strong>Awakening Explorer</strong></p>\n\n						<p>Awakening Explorers have had between 60 &ndash; 100 hours of coaching or tutoring, and are beginning to enter self-mastery, as they progress towards becoming Enlightened Masters!</p>\n						</td>\n					</tr>\n					<tr>\n						<td><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573471023_upload.png\" /></strong></td>\n						<td>\n						<p>&nbsp;</p>\n\n						<p><strong>Enlightened Master</strong></p>\n\n						<p>Enlightened Masters have had more than 100 hours of coaching or tutoring, and are changing the world with their wisdom!</p>\n						</td>\n					</tr>\n				</tbody>\n			</table>\n\n			<p>&nbsp;</p>\n\n			<h2>Coach / Tutor Badges</h2>\n\n			<p>We have four different badges that the coaches and tutors can achieve based on their&nbsp;experience on the Sterkla platform.&nbsp;</p>\n\n			<p>&nbsp;</p>\n\n			<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\">\n				<tbody>\n					<tr>\n						<td><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573471381_upload.png\" /></strong></td>\n						<td>\n						<p><strong>Bright Spark</strong></p>\n\n						<p>Bright Sparks are super smart coaches or tutors who are still building up their hours on Sterkla. They have done less than 150 hours of coaching or tutoring on Sterkla!</p>\n						</td>\n					</tr>\n					<tr>\n						<td><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573471439_upload.png\" /></strong></td>\n						<td>\n						<p><br />\n						<strong>Rising Star</strong></p>\n\n						<p>Rising Stars are coaches or tutors who are beginning to shine with their growing number of hours on Sterkla. They have done between 150 &ndash; 400 hours of coaching or tutoring on Sterkla!</p>\n						</td>\n					</tr>\n					<tr>\n						<td><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573471458_upload.png\" /></strong></td>\n						<td>\n						<p>&nbsp;</p>\n\n						<p><strong>Shooting Star</strong></p>\n\n						<p>Shooting Stars are coaches or tutors who are really standing out through their brilliance and amazing experience.&nbsp; They have done between 400 &ndash; 1000 hours of coaching or tutoring on Sterkla!</p>\n						</td>\n					</tr>\n					<tr>\n						<td><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573471475_upload.png\" /></strong></td>\n						<td>\n						<p>&nbsp;</p>\n\n						<p><strong>Super Star</strong></p>\n\n						<p>Super Stars are our most experienced coaches and tutors and are awakening the world with their coaching and tutoring superpowers. They have done over 1000 hours of coaching or tutoring on Sterkla!</p>\n						</td>\n					</tr>\n				</tbody>\n			</table>\n\n			<p>&nbsp;</p>\n\n			<p>Once again, welcome to Sterkla and congratulations on taking the first step on your amazing journey of learning and self-discovery.&nbsp; We are always here to help whenever you need us, simply contact us at <a href=\"mailto:members@sterkla.com\">members@sterkla.com</a> or for general support <a href=\"mailto:support@sterkla.com\">support@sterkla.com</a>.</p>\n\n			<p>&nbsp;</p>\n\n			<p>Warmest regards,</p>\n\n			<h3><strong>The Sterkla Team</strong></h3>\n\n			<p><strong><a href=\"mailto:members@sterkla.com\">members@sterkla.com</a></strong></p>\n\n			<p><strong><a href=\"http://www.sterkla.com\">www.sterkla.com</a></strong></p>\n\n			<p><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1586956587_upload.png\" style=\"height:139px; width:400px\" /></strong></p>\n			</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"color:#1f4067\">Coach Badges</span></h2>\n\n<p>We have four different badges that the coaches can achieve based on their&nbsp;experience on the Sterkla platform.&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:500px\">\n	<tbody>\n		<tr>\n			<td><span style=\"color:#1f4067\"><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573471381_upload.png\" style=\"float:left; height:73px; width:73px\" /></strong></span></td>\n			<td>\n			<p><span style=\"color:#1f4067\"><strong>Bright Spark</strong></span></p>\n\n			<p>Bright Sparks are super smart coaches who are still building their experience on Sterkla and have less than 150 hours of Sterkla coaching experience!</p>\n			</td>\n		</tr>\n		<tr>\n			<td><span style=\"color:#1f4067\"><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573471439_upload.png\" style=\"float:left; height:71px; width:71px\" /></strong></span></td>\n			<td>\n			<p><br />\n			<span style=\"color:#1f4067\"><strong>Rising Star</strong></span></p>\n\n			<p>Rising Stars are coaches who are beginning to shine with their growing experience and skills and have between 150 - 400 hours of coaching experience on Sterkla!</p>\n			</td>\n		</tr>\n		<tr>\n			<td><span style=\"color:#1f4067\"><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573471458_upload.png\" style=\"float:left; height:70px; width:70px\" /></strong></span></td>\n			<td>\n			<p>&nbsp;</p>\n\n			<p><span style=\"color:#1f4067\"><strong>Shooting Star</strong></span></p>\n\n			<p>Shooting Stars are coaches who are really standing out through their brilliance and amazing experience.&nbsp; They have between 400 - 1000 hours of coaching experience on Sterkla!</p>\n			</td>\n		</tr>\n		<tr>\n			<td><span style=\"color:#1f4067\"><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573471475_upload.png\" style=\"float:left; height:70px; width:70px\" /></strong></span></td>\n			<td>\n			<p>&nbsp;</p>\n\n			<p><span style=\"color:#1f4067\"><strong>Super Star</strong></span></p>\n\n			<p>Super Stars are our most experienced coaches and are awakening the world with their coaching superpowers, they have over 1000 hours of coaching experience on Sterkla!</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<p>Once again, welcome to Sterkla and congratulations on taking the first step on your amazing journey of self-discovery.&nbsp; We are always here to help whenever you need us, simply contact us at <a href=\"mailto:members@sterkla.com\">members@sterkla.com</a> or for general support <a href=\"mailto:support@sterkla.com\">support@sterkla.com</a>.</p>\n\n<p>&nbsp;</p>\n\n<p>Warmest regards,</p>\n\n<h3><span style=\"color:#1f4067\"><strong>The Sterkla Team</strong></span></h3>\n\n<p><strong><a href=\"mailto:members@sterkla.com\">members@sterkla.com</a></strong></p>\n\n<p><strong><a href=\"http://www.sterkla.com\">www.sterkla.com</a></strong></p>\n\n<p><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573469577_upload.png\" style=\"float:left; height:139px; width:400px\" /></strong></p>\n'),(3,'Coach Declined','Sterkla Coach / Tutor Application','<p>Hi FIRST_NAME,</p>\n\n<p>Thanks so much for taking the time to submit your coach or tutor application, we really love it when people like yourself show enthusiasm towards Sterkla and our mission of making coaching and tutoring accessible to everyone on the planet.</p>\n\n<p>&nbsp;</p>\n\n<hr />\n<p>&nbsp;</p>\n\n<p>Unfortunately, we can not approve your application for one of the following reasons:</p>\n\n<p>&nbsp;</p>\n\n<ol>\n	<li>\n	<h3>You did not supply a copy of your coaching or tutoring certification/s.&nbsp; If this is the case, please resubmit your application and either upload copies of your certification/s or email them to <a href=\"mailto:coaches@sterkla.com\">coaches@sterkla.com</a></h3>\n	</li>\n	<li>\n	<h3>We felt that you did not have adequate&nbsp;certification.</h3>\n	</li>\n	<li>\n	<h3>Your certifications were not relevant to your chosen&nbsp;categories.</h3>\n	</li>\n</ol>\n\n<p>&nbsp;</p>\n\n<hr />\n<p>&nbsp;</p>\n\n<p>If you feel that we have missed something please contact <a href=\"mailto:coaches@sterkla.com\">coaches@sterkla.com</a>. Otherwise, please know that you are always welcome to re-apply after completing more certified training relevant to your categories. Please remember, that the world needs people like you, people who want to make a difference by helping others.</p>\n\n<p>Again, we really appreciate you taking the time to apply to Sterkla.</p>\n\n<p>&nbsp;</p>\n\n<p>Warmest regards,</p>\n\n<h3><strong>The Sterkla Team</strong></h3>\n\n<p><strong>coaches@sterkla.com</strong></p>\n\n<p><strong>www.sterkla.com</strong></p>\n\n<p><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1586956129_upload.png\" style=\"height:139px; width:400px\" /></strong></p>\n'),(4,'Reset Password','Password Reset','<p>Hi FIRST_NAME,</p>\n\n<p>&nbsp;</p>\n\n<p>To reset your password please <strong>(CLICK HERE)</strong></p>\n\n<p>If you did not request your password to be reset, please contact <a href=\"mailto:support@sterkla.com\">support@sterkla.com</a>.</p>\n\n<p>&nbsp;</p>\n\n<p>Regards,</p>\n\n<h3><strong>The Sterkla Team</strong></h3>\n\n<p><strong>www.sterkla.com</strong></p>\n\n<p><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1586956627_upload.png\" style=\"height:139px; width:400px\" /></strong></p>\n'),(5,'Book Appointment','Sterkla -  Congratulations, you have a new appointment request!','<p>Hi CFIRSTNAME,</p>\n\n<p>&nbsp;</p>\n\n<p>MFIRSTNAME MLASTNAME&nbsp;has requested an&nbsp;appointment with you for the following time.&nbsp; Please <a href=\"https://app.sterkla.com/login\">login</a>&nbsp;to your Sterkla account or open the mobile app to respond to this request.&nbsp;&nbsp;Once you accept this appointment request, it is confirmed.</p>\n\n<p>&nbsp;</p>\n\n<hr />\n<h2><strong>Appointment Date:</strong> (DATE)</h2>\n\n<h2><strong>Appointment Time:</strong> (TIME)</h2>\n\n<hr />\n<p>&nbsp;</p>\n\n<h2>Initiating the Video Call</h2>\n\n<p>15 minutes before the start time of your appointment, a green video call button will appear on the appointment screen, as shown below.&nbsp; Simply click or tap this to initiate the video call.&nbsp; You can choose to have the video call via the mobile app or the web app.</p>\n\n<p>&nbsp;</p>\n\n<p><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1580114620_upload.png\" /></p>\n\n<p>&nbsp;</p>\n\n<h2><em>Important</em></h2>\n\n<ul>\n	<li><em>Sterkla does not support Microsoft Edge (Internet Explorer) for video calling, because they do not meet our security standards.&nbsp;&nbsp;</em></li>\n	<li><em>If you are taking the call via the mobile app, please ensure that you are connected to a WiFi network, or alternatively disable the &quot;Use video calling on WiFi only&quot; setting to use mobile data.</em></li>\n	<li><em>Please ensure that you have good internet speed.</em></li>\n	<li><em>If you receive a phone call during a video call, the video call will be paused temporarily.</em></li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p>Warmest regards,</p>\n\n<h3><strong>The Sterkla Team</strong></h3>\n\n<p><strong>coaches@sterkla.com</strong></p>\n\n<p><strong>www.sterkla.com</strong></p>\n\n<p><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1586956731_upload.png\" style=\"height:139px; width:400px\" /></strong></p>\n'),(7,'Reject Appointment','Sterkla -  Appointment Rejected','<p>Hi&nbsp;MFIRSTNAME,</p>\n\n<p>&nbsp;</p>\n\n<p>Your request for an&nbsp;appointment with CFIRSTNAME CLASTNAME&nbsp;has been rejected.&nbsp; Please see the reason for this rejection below and communicate with&nbsp;CFIRSTNAME to arrange another time or resolve the issue.&nbsp; You can message&nbsp;CFIRSTNAME from the app.</p>\n\n<p>&nbsp;</p>\n\n<hr />\n<h2><strong>Appointment Date:</strong> (DATE)</h2>\n\n<h2><strong>Appointment Time:</strong> (TIME)</h2>\n\n<h3><strong>Reason:&nbsp;</strong>(REASON)</h3>\n\n<hr />\n<p>&nbsp;</p>\n\n<p>Warmest regards,</p>\n\n<h3><strong>The Sterkla Team</strong></h3>\n\n<p><strong>members@sterkla.com</strong></p>\n\n<p><strong>www.sterkla.com</strong></p>\n\n<p><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1586957664_upload.png\" style=\"height:139px; width:400px\" /></strong></p>\n'),(8,'Member Cancel Appointment','Sterkla - Appointment Cancelled','<p>Hi CFIRSTNAME,</p>\n\n<p>&nbsp;</p>\n\n<p>Your&nbsp;appointment has been cancelled by MFIRSTNAME MLASTNAME.</p>\n\n<p>&nbsp;</p>\n\n<hr />\n<h2><strong>Appointment Date:</strong> (DATE)</h2>\n\n<h2><strong>Appointment Time:</strong> (TIME)</h2>\n\n<h3><strong>Reason:&nbsp;</strong>(REASON)</h3>\n\n<hr />\n<p>&nbsp;</p>\n\n<p>Warmest regards,</p>\n\n<h3><strong>The Sterkla Team</strong></h3>\n\n<p><strong>www.sterkla.com</strong></p>\n\n<p><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1586957085_upload.png\" style=\"height:139px; width:400px\" /></strong></p>\n'),(9,'Coach Cancel Appointment','Sterkla - Appointment Cancelled','<p>Hi MFIRSTNAME,</p>\n\n<p>&nbsp;</p>\n\n<p>Your&nbsp;appointment has been cancelled by CFIRSTNAME CLASTNAME.&nbsp;Please see the reason for this rejection below and communicate with&nbsp;CFIRSTNAME to arrange another time or resolve the issue.&nbsp; You can message&nbsp;CFIRSTNAME from the app.</p>\n\n<p>&nbsp;</p>\n\n<hr />\n<h2><strong>Appointment Date:</strong> (DATE)</h2>\n\n<h2><strong>Appointment Time:</strong> (TIME)</h2>\n\n<h3><strong>Reason:&nbsp;</strong>(REASON)</h3>\n\n<hr />\n<p>&nbsp;</p>\n\n<p>Warmest regards,</p>\n\n<h3><strong>The Sterkla Team</strong></h3>\n\n<p><strong>www.sterkla.com</strong></p>\n\n<p><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1586957388_upload.png\" style=\"height:139px; width:400px\" /></strong></p>\n'),(10,'Coach Accept Appointment','Fantastic News!!! Your appointment request has been accepted.','<p>Hi MFIRSTNAME,</p>\n\n<p>&nbsp;</p>\n\n<p>Fantastic news, your appointment request has been accepted by CFIRSTNAME CLASTNAME.&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<hr />\n<h2><strong>Appointment Date:</strong> (DATE)</h2>\n\n<h2><strong>Appointment Time:</strong> (TIME)</h2>\n\n<hr />\n<p>&nbsp;</p>\n\n<h2>Initiating the Video Call</h2>\n\n<p>15 minutes before the start time of your appointment, a green video call button will appear on the appointment screen, as shown below.&nbsp; Simply click or tap this to initiate the video call.</p>\n\n<p>&nbsp;</p>\n\n<p><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1578907834_upload.png\" /></p>\n\n<h2>&nbsp;</h2>\n\n<h2>Cancellation Terms</h2>\n\n<p>Please be aware of our cancellation terms.&nbsp; Should you wish to cancel this appointment,&nbsp;you will need to cancel&nbsp;it at least 12 hours before to avoid a cancellation fee.&nbsp; If you cancel within 12 hours but more than 4 hours before, you will only be refund 50% of the appointment fee.&nbsp; Any cancellations within 4 hours of the appointment start time will not be refunded.&nbsp;&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<h2><em>Important</em></h2>\n\n<ul>\n	<li><em>Sterkla does not support Microsoft Edge (Internet Explorer) for video calling, because they do not meet our security standards.&nbsp;&nbsp;</em></li>\n	<li><em>If you are taking the call via the mobile app, please ensure that you are connected to a WiFi network, or alternatively disable the &quot;Use video calling on WiFi only&quot; setting to use mobile data.</em></li>\n	<li><em>Please ensure that you have good internet speed.</em></li>\n	<li><em>If you receive a phone call during a video call, the video call will be paused temporarily.</em></li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p>Warmest regards,</p>\n\n<h3><strong>The Sterkla Team</strong></h3>\n\n<p><strong>www.sterkla.com</strong></p>\n\n<p><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1586957215_upload.png\" /></strong></p>\n');
