ri,sans-serif\"><span style=\"font-size:36.0pt\"><span style=\"font-family:Rubik\"><a href=\"https://sterkla.com/knowledge-base/how-do-i-rate-a-coach-tutor/\"><span style=\"color:blue\">How do I rate a coach or tutor?</span></a></span></span></span></span></li>\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:36.0pt\"><span style=\"font-family:Rubik\"><a href=\"https://sterkla.com/knowledge-base/how-do-i-rate-a-quick-course/\"><span style=\"color:blue\">How do I rate a Quick Course?</span></a></span></span></span></span></li>\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:36.0pt\"><span style=\"font-family:Rubik\"><a href=\"https://sterkla.com/knowledge-base/do-coaches-tutors-rate-me/\"><span style=\"color:blue\">Do coaches &amp; tutors rate me?</span></a></span></span></span></span></li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:36.0pt\"><span style=\"font-family:Rubik\">Quick Courses</span></span></span></span></p>\n\n<p>&nbsp;</p>\n\n<ul>\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:36.0pt\"><span style=\"font-family:Rubik\"><a href=\"https://sterkla.com/knowledge-base/how-is-quick-courses-different-from-an-online-course/\"><span style=\"color:blue\">How is a Quick Course different from an online course?</span></a></span></span></span></span></li>\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:36.0pt\"><span style=\"font-family:Rubik\"><a href=\"https://sterkla.com/knowledge-base/sampling-a-quick-course/\"><span style=\"color:blue\">Trying a Quick Course for FREE</span></a></span></span></span></span></li>\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:36.0pt