editing my categories</span></a></span></span></span></span></li>\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:36.0pt\"><span style=\"font-family:Rubik\"><a href=\"https://sterkla.com/knowledge-base/settings/\"><span style=\"color:blue\">Settings</span></a></span></span></span></span></li>\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:36.0pt\"><span style=\"font-family:Rubik\"><a href=\"https://sterkla.com/knowledge-base/how-do-i-change-my-password/\"><span style=\"color:blue\">How do I change my password?</span></a></span></span></span></span></li>\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:36.0pt\"><span style=\"font-family:Rubik\"><a href=\"https://sterkla.com/knowledge-base/deleting-my-account/\"><span style=\"color:blue\">How do I delete&nbsp;my account?</span></a></span></span></span></span></li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:36.0pt\"><span style=\"font-family:Rubik\">Messages &amp; Notifications</span></span></span></span></p>\n\n<p>&nbsp;</p>\n\n<ul>\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:36.0pt\"><span style=\"font-family:Rubik\"><a href=\"https://sterkla.com/knowledge-base/messages/\"><span style=\"color:blue\">Messages</span></a></span></span></span></span></li>\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><u><span style=\"font-size:36.0pt\"><span style=\"font-family:Rubik\"><a href=\"https://sterkla.com/knowledge-base/how-do-i-delete-a-message/\"><span style=\"color:blue\">How do I delete a message?</span></a></span></span></u></span></span></li>\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><u><span style=\