INSERT INTO `levels` VALUES (1,'Rookie',0,20,'1557998735_imageUpload.jpg','Member','Rookies have had less than 10 hours of coaching or tutoring, and are beginning their exciting journey of personal growth, as they move towards becoming Explorers!'),(2,'Explorer',600,10,'1557998953_imageUpload.jpg','Member','Explorers have had between 10 – 60 hours of coaching or tutoring, and are fast building self-awareness and knowledge, as they move towards becoming Awakening Explorers!'),(3,'Awakening Explorer',3600,15,'1557998996_imageUpload.jpg','Member','Awakening Explorers have had between 60 – 100 hours of coaching or tutoring, and are beginning to enter self-mastery, as they progress towards becoming Enlightened Masters!'),(4,'Enlightened Master',6000,20,'1557999057_imageUpload.jpg','Member','Enlightened Masters have had more than 100 hours of coaching or tutoring, and are changing the world with their wisdom!'),(5,'Bright Spark',0,75,'1557999848_imageUpload.jpg','Coach','Bright Sparks are super smart coaches or tutors who are still building up their hours on Sterkla. They have done less than 150 hours of coaching or tutoring on Sterkla!'),(6,'Rising Star',150,75,'1557999903_imageUpload.jpg','Coach','Rising Stars are coaches or tutors who are beginning to shine with their growing number of hours on Sterkla. They have done between 150 – 400 hours of coaching or tutoring on Sterkla!'),(7,' Shooting Star',24000,75,'1557999938_imageUpload.jpg','Coach','Shooting Stars are coaches or tutors who are really standing out through their brilliance and amazing experience. They have done between 400 – 1000 hours of coaching or tutoring on Sterkla!'),(8,'Super Star',60000,75,'1557999965_imageUpload.jpg','Coach','Super Stars are our most experienced coaches and tutors and are awakening the world with their coaching and tutoring superpowers. They have done over 1000 hours of coaching or tutoring on Sterkla!');
/*!40000 ALTER TABLE `levels` ENABLE KEYS */;
