/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `tb_chat` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `m_chat_id` varchar(255) NOT NULL,
  `s_id` int(11) NOT NULL,
  `r_id` int(11) NOT NULL,
  `msg` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `url` varchar(255) NOT NULL,
  `thumb_url` varchar(255) NOT NULL,
  `msg_type` enum('text','photo','gif','video','share','image','pdf','file') NOT NULL DEFAULT 'text',
  `read_status` enum('read','unread') NOT NULL,
  `chat_status` enum('active','inactive') NOT NULL,
  `delete_for_everyone` enum('0','1') NOT NULL,
  `deleted_by` varchar(4) NOT NULL,
  `send_by` enum('coach','member') NOT NULL,
  `date_added` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1005 DEFAULT CHARSET=latin1;
