italists. Then, after a few years, if all goes according to plan, they hit the big time — an initial public offering and a chance to be the next face of the future.\n\nWell, sometimes. What’s often left out of the start-up dream story is any mention that there’s another way.\nShow Full Article\nADVERTISEMENT\n\nState of the Art\nA column from Farhad Manjoo that examines how technology is changing business and society.\n\nHow to Survive the Next Era of Tech (Slow Down and Be Mindful)\nNov. 28, 2018\n\nHow Google Photos Became a Perfect Jukebox for Our Memories\nNov. 14, 2018\n\nWhy the Google Walkout Was a Watershed Moment in Tech\nNov. 7, 2018\nMore in Technology\n\nAngie Wang\nChina’s Cryptocurrency Plan Has a Powerful Partner: Big Brother\nOct. 18\nMark Hurd at the Oracle OpenWorld Conference in San Francisco in 2014.\nMark Hurd, Co-Chief Executive of Oracle, Is Dead at 62\nOct. 18\nRepresentative David Cicilline, chairman of the antitrust subcommittee, which heard testimony from experts on the market power of tech giants.\nIn House Antitrust Hearing, Lawmakers Focus on Harms to Privacy\nOct. 18\nEditors’ Picks\n\nEiko Ojala\nHow Moving to France and Having Children Led a Black American to Rethink Race\nOct. 14\nAlexander Rapaport, a Hasidic Jew, gives a tour of a building in Borough Park, Brooklyn, where many of the Hasidic merchants do business through Amazon.\nHow Amazon Has Transformed the Hasidic Economy\nOct. 16\nPresident Trump at the opening of the new Louis Vuitton Rochambeau Ranch, a 100,000-square-foot workshop in Texas. Michael Burke, the company’s chief executive, is at right.\nWhen Brand Trump Met Brand Vuitton\nOct. 18\nADVERTISEMENT\nAccess more of The Times by creating a free account or logging in.\nAccess more for free.','','','text','read','active','0','','member','2019-10-19 18:06:14'),(77,'86_0',86,0,'image','','','image','unread','active','0','','','2019-10-19 18:11:09'),(78,'86_72',86,72,'image','https://s3-us-west-2.amazonaws.com/sterklasta